import styled from "styled-components";
const textOption = ['Plan Amigo', 'AlonsoFormula1', 'FAQ'];

const Options = styled.ul`
  display: flex;
  width: 500px;
`

const OptionsList = styled.li`
  padding: 0 0.313rem;
  min-width: 7.5rem;
  cursor: pointer;
  display: flex;
  justify-content: center;
  align-items: center;
  text-align: center;
  font-size: 1rem;
  height: 100%;
  font-family
`

function OptionsHeader() {
  return (
    <Options>
      {textOption.map((text, key) => <OptionsList key={key}><p>{text}</p></OptionsList>)}
    </Options>
  )
};

export default OptionsHeader;
